// Violin Multi-Sample System
// This file contains base64 encoded audio samples for different violin notes
// to achieve more realistic sound without excessive transposition

// Violin samples for different notes
VIOLIN_A5_SAMPLE = function() { return "data:audio/wav;base64,"; };
VIOLIN_E6_SAMPLE = function() { return "data:audio/wav;base64,"; };
VIOLIN_A4_SAMPLE = function() { return "data:audio/wav;base64,"; };
VIOLIN_D4_SAMPLE = function() { return "data:audio/wav;base64,"; };
VIOLIN_E5_SAMPLE = function() { return "data:audio/wav;base64,"; };
VIOLIN_G3_SAMPLE = function() { return "data:audio/wav;base64,"; };

// Function to verify that all violin samples are different
function verifyViolinMultiSamples() {
    console.log("🎻 VIOLIN MULTI-SAMPLE VERIFICATION 🎻");
    
    // Get sample lengths
    const a5Length = VIOLIN_A5_SAMPLE().length;
    const e6Length = VIOLIN_E6_SAMPLE().length;
    const a4Length = VIOLIN_A4_SAMPLE().length;
    const d4Length = VIOLIN_D4_SAMPLE().length;
    const e5Length = VIOLIN_E5_SAMPLE().length;
    const g3Length = VIOLIN_G3_SAMPLE().length;
    
    console.log("A5 Sample Length:", a5Length);
    console.log("E6 Sample Length:", e6Length);
    console.log("A4 Sample Length:", a4Length);
    console.log("D4 Sample Length:", d4Length);
    console.log("E5 Sample Length:", e5Length);
    console.log("G3 Sample Length:", g3Length);
    
    // Calculate hashes for content comparison
    const a5Hash = hashString(VIOLIN_A5_SAMPLE());
    const e6Hash = hashString(VIOLIN_E6_SAMPLE());
    const a4Hash = hashString(VIOLIN_A4_SAMPLE());
    const d4Hash = hashString(VIOLIN_D4_SAMPLE());
    const e5Hash = hashString(VIOLIN_E5_SAMPLE());
    const g3Hash = hashString(VIOLIN_G3_SAMPLE());
    
    console.log("Sample Hashes:");
    console.log("A5 Hash:", a5Hash);
    console.log("E6 Hash:", e6Hash);
    console.log("A4 Hash:", a4Hash);
    console.log("D4 Hash:", d4Hash);
    console.log("E5 Hash:", e5Hash);
    console.log("G3 Hash:", g3Hash);
    
    // Check if all samples are different
    const allHashes = [a5Hash, e6Hash, a4Hash, d4Hash, e5Hash, g3Hash];
    const uniqueHashes = new Set(allHashes);
    const samplesAreDifferent = uniqueHashes.size === allHashes.length;
    
    if (samplesAreDifferent) {
        console.log("✅ SUCCESS: All violin samples have different content - multi-sampling is working!");
    } else {
        console.log("❌ WARNING: Some violin samples have identical content - check if they are actually different");
        
        // Find which samples are identical
        const duplicateHashes = [];
        for (let i = 0; i < allHashes.length; i++) {
            for (let j = i + 1; j < allHashes.length; j++) {
                if (allHashes[i] === allHashes[j]) {
                    const noteNames = ["A5", "E6", "A4", "D4", "E5", "G3"];
                    duplicateHashes.push(`${noteNames[i]} and ${noteNames[j]}`);
                }
            }
        }
        
        if (duplicateHashes.length > 0) {
            console.log("Duplicate samples found:", duplicateHashes);
        }
    }
    
    // Check for length differences as additional verification
    const allLengths = [a5Length, e6Length, a4Length, d4Length, e5Length, g3Length];
    const uniqueLengths = new Set(allLengths);
    
    if (uniqueLengths.size === allLengths.length) {
        console.log("✅ All samples have different lengths - good sign!");
    } else {
        console.log("⚠️ Some samples have the same length - check if they are actually different");
    }
    
    return {
        a5Length, e6Length, a4Length, d4Length, e5Length, g3Length,
        a5Hash, e6Hash, a4Hash, d4Hash, e5Hash, g3Hash,
        samplesAreDifferent
    };
}

// Simple hash function for string comparison
function hashString(str) {
    let hash = 0;
    if (str.length === 0) return hash;
    for (let i = 0; i < str.length; i++) {
        const char = str.charCodeAt(i);
        hash = ((hash << 5) - hash) + char;
        hash = hash & hash; // Convert to 32-bit integer
    }
    return hash;
}

// Export for use in other files
if (typeof module !== 'undefined' && module.exports) {
    module.exports = {
        VIOLIN_A5_SAMPLE,
        VIOLIN_E6_SAMPLE,
        VIOLIN_A4_SAMPLE,
        VIOLIN_D4_SAMPLE,
        VIOLIN_E5_SAMPLE,
        VIOLIN_G3_SAMPLE,
        verifyViolinMultiSamples
    };
}
